import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import * as serviceWorker from "./serviceWorker";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import './fonts/SmartFrocks/SmartFrocksNf-BdrG.ttf';
import {
  Navigation,
  Home,
  Epk,
  Contact,
} from "./components";

const linkStyle = {
  "font-family": "SmartFrocks",
  color: blue
}

ReactDOM.render(
  //<div style ={{backgroundImage: `url($background)`}}></div>
  <Router style = {{backgroundImage: `url($background)`}}>
    <Navigation />
    <main className = "main-content">
    <Routes>
      <Route path="/" style={linkStyle} element={<Home />} />
      <Route path="/epk" style={linkStyle} element={<Epk />} />
      <Route path="/contact"style={linkStyle} element={<Contact />} />
   
    </Routes>
  </main>
  </Router>,
  document.getElementById("root")
);

serviceWorker.unregister();
